/*Data for the table `tbl_mail_templates` */

insert  into `tbl_mail_templates`(`id`,`name`,`subject`,`mailbody`,`modified_by`,`modified_on`) values (1,'initiationmail','Initiation Mail','<div class=\"_3U2q6dcdZCrTrR_42Nxby JWNdg1hee9_Rz6bIGvG1c allowTextSelection\" style=\"border:1px solid silver;padding:5px;\">\r\n							<div>\r\n								<div>\r\n									<div>\r\n										<div dir=\"ltr\"><font size=\"4\">\r\n										<div style=\"text-align:center;\">Welcome to the world of<b> KAIWA</b></div>\r\n										</font>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">Our A.I. Chatbot, KAIWA engages you through smart conversations across employee lifecycles.</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">\r\n										<img src=\"chatbot-1.png\" width=\"472\" height=\"173\" alt=\"blog-banner-ai-powered-chatbot-1.png\" style=\"cursor: pointer;\" crossorigin=\"use-credentials\">\r\n										</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\"><b><u><a href=\"appurl\">CLICK HERE TO BEGIN YOUR CONVERSATION!</a></u></b></div>\r\n										<div style=\"text-align:center;\">...</div>\r\n										<div>\r\n										<div style=\"text-align:center;\"><b><i><font size=\"4\">Continue reading...stories from KAIWA!</font></i></b></div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<b>\r\n										<div style=\"text-align:center;\"><b><font size=\"4\">Thinking out of the box!</font></b></div>\r\n										</b>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">\r\n										<img src=\"interview-question.jpg\" height=\"194\" alt=\"black-white-marbles-interview-question.jpg\" crossorigin=\"use-credentials\" style=\"cursor: pointer;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">In a small Italian town, hundreds of years ago, a small business owner owed a large sum of money to a loan-shark. The loan-shark was a very old, unattractive looking guy that just so happened to fancy the business owners daughter.</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">He decided to offer the businessman a deal that would completely wipe out the debt he owed him. However, the catch was that we would only wipe out the debt if he could marry the businessmans daughter.</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">Needless to say, this proposal was met with a look of disgust.</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">The loan-shark said that he would place two pebbles into a bag, one white and one black.</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">The daughter would then have to reach into the bag and pick out a pebble. If it was black, the debt would be wiped, but the loan-shark would then marry her. If it was white, the debt would also be wiped, but the daughter wouldnt\r\n										have to marry the loan-shark.</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">Standing on a pebble-strewn path in the businessmans garden, the loan-shark bent over and picked up two pebbles.</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">Whilst he was picking them up, the daughter noticed that hed picked up two black pebbles and placed them both into the bag.</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">He then asked the daughter to reach into the bag and pick one.</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">The daughter naturally had three choices as to what she could have done:</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">\r\n										<ol>\r\n										<li style=\"text-align:left;\">Refuse to pick a pebble from the bag.</li><li style=\"text-align:left;\">Take both pebbles out of the bag and expose the loan-shark for cheating.</li><li style=\"text-align:left;\">Pick a pebble from the bag fully well knowing it was black and sacrifice herself for her fathers freedom.</li></ol>\r\n										</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">She drew out a pebble from the bag, and before looking at it accidentally dropped it into the midst of the other pebbles. She said to the loan-shark;</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">Oh, how clumsy of me. Never mind, if you look into the bag for the one that is left, you will be able to tell which pebble I picked.</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">The pebble left in the bag is obviously black, and seeing as the loan-shark didnt want to be exposed, he had to play along as if the pebble the daughter dropped was white, and clear her fathers debt.</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\"><b>Moral of the story:</b></div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\">Its always possible to overcome a tough situation throughout of the box thinking, and not give in to the only options you think you have to pick from.</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										<div style=\"text-align:center;\"><br>\r\n\r\n										</div>\r\n										</div>\r\n									</div>\r\n								</div>\r\n							</div>\r\n						</div>',NULL,NULL),(2,'remaindermail','Remainder Mail','<div style=\"border:1px solid silver;padding:5px;\">\r\n						<div class=\"_3U2q6dcdZCrTrR_42Nxby JWNdg1hee9_Rz6bIGvG1c allowTextSelection\">\r\n							<div>\r\n								<div>\r\n								<div>\r\n								<div dir=\"ltr\"><font size=\"4\">\r\n								<div style=\"text-align:center;\">Welcome to the world of<b>&nbsp;KAIWA</b></div>\r\n								</font>\r\n								<div style=\"text-align:center;\"><br>\r\n\r\n								</div>\r\n								<div style=\"text-align:center;\">Our A.I. Chatbot, KAIWA awaits to engage you through smart conversations across employee lifecycles.</div>\r\n								<div style=\"text-align:center;\"><br>\r\n\r\n								</div>\r\n								<div style=\"text-align:center;\">\r\n									<img src=\"chatbot-1.png\" tabindex=\"0\" style=\"outline: 0px; cursor: pointer;\" crossorigin=\"use-credentials\">\r\n								</div>\r\n								<div style=\"text-align:center;\"><br>\r\n\r\n								</div>\r\n								<div style=\"text-align:center;\"><b><u><a href=\"appurl\">CLICK HERE TO BEGIN YOUR CONVERSATION!</a></u></b></div>\r\n								<div style=\"text-align:center;\">...</div>\r\n								<div>\r\n									<div style=\"text-align:center;\"><b><i><font size=\"4\">Continue reading...stories from KAIWA!</font></i></b></div>\r\n									<div style=\"text-align:center;\"><strong style=\"color:black;font-family:georgia,serif;vertical-align:baseline;margin:0;padding:0;border-width:0;letter-spacing:-0.02em;\"><br>\r\n\r\n									</strong></div>\r\n									<div style=\"text-align:center;\"><strong style=\"color:black;font-family:georgia,serif;vertical-align:baseline;margin:0;padding:0;border-width:0;letter-spacing:-0.02em;\"><font size=\"6\">The Group of Frogs</font></strong><br>\r\n\r\n									</div>\r\n									<b>\r\n									<div style=\"text-align:center;\"><font face=\"georgia,serif\">\r\n									<p style=\"color:black;font-weight:400;text-align:center;vertical-align:baseline;margin:0 0 20px 0;padding:0;border-width:0;line-height:2.4rem;\">\r\n									<span><img  width=\"580\" height=\"254\" alt=\"The Group of Frogs (Inspirational Short Stories)\" style=\"vertical-align:baseline;max-width:100%;margin:0;padding:0;border-width:0;opacity:1;\"></span></p>\r\n									</font></div>\r\n									</b>\r\n								</div>\r\n								<span style=\"color:black;font-family:georgia,serif;text-align:center;\">\r\n									<div style=\"text-align:center;\">As a group of frogs was traveling through the woods, two of them fell into a deep pit.&nbsp;When the other frogs crowded around the pit and saw how deep it was, they told the two frogs that there was no hope left for them.</div>\r\n									<div style=\"text-align:center;\"><br>\r\n\r\n									</div>\r\n								</span>\r\n								<span style=\"color:black;font-family:georgia,serif;text-align:center;\">\r\n									<div style=\"text-align:center;\">However, the two frogs decided to ignore what the others were saying and they proceeded to<strong style=\"vertical-align:baseline;margin:0;padding:0;border-width:0;\">&nbsp;try and jump out of the pit</strong>.</div>\r\n									<div style=\"text-align:center;\"><br>\r\n\r\n									</div>\r\n								</span>\r\n								<span style=\"color:black;font-family:georgia,serif;text-align:center;\">\r\n									<div style=\"text-align:center;\">Despite their efforts, the group of frogs at the top of the pit were still saying that they should just give up. That they would never make it out.</div>\r\n								</span>\r\n								<span style=\"color:black;font-family:georgia,serif;text-align:center;\">\r\n									<div style=\"text-align:center;\">Eventually, one of the frogs took heed to what the others were saying and he gave up, falling down to his death.&nbsp;The other frog continued to jump as hard as he could. Again, the crowd of frogs yelled at him to stop the pain and\r\n									just die.</div>\r\n									<div style=\"text-align:center;\"><br>\r\n\r\n									</div>\r\n								</span>\r\n								<span style=\"color:black;font-family:georgia,serif;text-align:center;\">\r\n									<div style=\"text-align:center;\">He jumped even harder and finally made it out. When he got out, the other frogs said,&nbsp;<strong style=\"vertical-align:baseline;margin:0;padding:0;border-width:0;\">Did you not hear us?</strong></div>\r\n								</span>\r\n								<span style=\"color:black;font-family:georgia,serif;text-align:center;\">\r\n									<div style=\"text-align:center;\">The frog explained to them that he was deaf.&nbsp;</div>\r\n									<div style=\"text-align:center;\"><br>\r\n\r\n									</div>\r\n									<div style=\"text-align:center;\">He thought&nbsp;<strong style=\"vertical-align:baseline;margin:0;padding:0;border-width:0;\">they were encouraging him</strong>&nbsp;the entire time.</div>\r\n								</span>\r\n								<strong style=\"color:black;font-family:georgia,serif;text-align:center;vertical-align:baseline;margin:0;padding:0;border-width:0;letter-spacing:-0.02em;\">\r\n									<div style=\"text-align:center;\"><strong style=\"vertical-align:baseline;margin:0;padding:0;border-width:0;letter-spacing:-0.02em;\"><br>\r\n\r\n									</strong></div>\r\n									<div style=\"text-align:center;\"><strong style=\"vertical-align:baseline;margin:0;padding:0;border-width:0;letter-spacing:-0.02em;\">Moral of the story:</strong></div>\r\n								</strong>\r\n								<div><b>\r\n									<div style=\"text-align:center;\"><font face=\"georgia,serif\">\r\n									<p style=\"color:black;font-weight:400;text-align:center;vertical-align:baseline;margin:0 0 20px 0;padding:0;border-width:0;line-height:2.4rem;\">\r\n									Peoples words can have a big effect on others lives. Think about what you say before it comes out of your mouth.&nbsp;</p>\r\n									<p style=\"color:black;font-weight:400;text-align:center;vertical-align:baseline;margin:0 0 20px 0;padding:0;border-width:0;line-height:2.4rem;\">\r\n									It might just be the difference between life and death.</p>\r\n									</font></div>\r\n									</b>\r\n								</div>\r\n								\r\n								</div>\r\n								</div>\r\n								</div>\r\n							</div>\r\n						</div>\r\n						<div class=\"_1yuNDaQBDoy0YwHOMGXFkz\"></div>\r\n					</div>',NULL,NULL);

